INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1000001, 62, 1, 0.0, 1, "2025/01/31 12:00:00", 190801, 3.414, "2030/01/01 14:59:59", -416.5, 1, "カリン", "ミッションをクリアすると、\n報酬がもらえますよ！\n頑張ってください");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1000002, 62, 1, 0.0, 1, "2025/01/31 12:00:00", 190801, 3.099, "2030/01/01 14:59:59", -416.5, 2, "カリン", "ミッションをクリアして、\n報酬をゲットしましょう！");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1000003, 63, 1, 0.0, 1, "2025/01/31 12:00:00", 190801, 2.801, "2030/01/01 14:59:59", -416.5, 3, "カリン", "受け取ることができる\n報酬があるようです\n確認してみてください");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1000004, 63, 2, 0.0, 1, "2025/01/31 12:00:00", 190801, 0.0, "2030/01/01 14:59:59", -416.5, 4, "カリン", "報酬がもらえますよ！\nチェックしてみてください");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (1, 1000005, 64, 2, 0.0, 1, "2025/01/31 12:00:00", 190801, 2.12, "2030/01/01 14:59:59", -363.0, 5, "カリン", "ギルド管理協会です！\nイベント報酬券をお持ちでしたら、様々なアイテムと交換できますよ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1000006, 64, 1, 0.0, 1, "2025/01/31 12:00:00", 190801, 1.68, "2030/01/01 14:59:59", -363.0, 6, "カリン", "お疲れさまです！\nこちらでイベント報酬券とアイテムを交換することができますよ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (1, 1000007, 64, 2, 0.0, 1, "2025/01/31 12:00:00", 190801, 2.33, "2030/01/01 14:59:59", -363.0, 7, "カリン", "いつもありがとうございます！\n報酬交換ですか？\nでは、イベント報酬券とお引き換えいたしますね");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (7, 1020101, 61, 3, -6.0, 10201, "2025/01/31 12:00:00", 133701, 5.18, "2030/01/01 14:59:59", -285.0, 101, "ラビリスタ", "今度の敵は、アタシにとっても\n放ってはおけない存在だ\n少年、アタシも全力で行くからさ\n一緒に守ろう、この世界を");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1020102, 61, 1, -2.0, 10201, "2025/01/31 12:00:00", 133901, 8.77, "2030/01/01 14:59:59", -285.0, 201, "クリスティーナ", "退屈の吹き飛ぶような\n戦いの気配がするなぁ坊や\nさっさとワタシをそこへ連れてゆけ\n世界も守ってやるさ、ついでにな");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (1, 1020103, 61, 6, 0.0, 10201, "2025/01/31 12:00:00", 133801, 15.5, "2030/01/01 14:59:59", -285.0, 301, "ネネカ", "おや、私の力が必要……と？\nグレゴールが手伝うそうですよ\n私は戦わないのか、という顔ですね\n……考えておきます");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (5, 1020201, 61, 2, 0.0, 10202, "2025/02/28 12:00:00", 134301, 9.061, "2030/01/01 14:59:59", -285.0, 101, "ランファ", "わたしだけの歌…\n一緒に、探してくれる…？\nあなたがいれば…\nもっとがんばれるから…");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1020202, 61, 1, 0.0, 10202, "2025/02/28 12:00:00", 134401, 7.699, "2030/01/01 14:59:59", -285.0, 201, "チカ", "同じ唱喚士として、仲間として\n私にできることをします\n…これも、あなたが\n背中を押してくれたおかげですよ");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1020301, 61, 1, 0.0, 10203, "2025/03/31 12:00:00", 134601, 8.595, "2030/01/01 14:59:59", -285.0, 101, "アオイ", "世界の平和が私とクローチェさんに\nかかってるんですよね？\nぼっちには過大すぎる期待ですけど\nふ、二人でなら背負ってみせます！");
INSERT INTO `v1_193a6bff9e3ec27bb4023abdd15ad33cfa381c550c1bb79a8ced7c2de774d0bb` VALUES (2, 1020302, 61, 1, 0.0, 10203, "2025/03/31 12:00:00", 134501, 7.758, "2030/01/01 14:59:59", -285.0, 201, "クローチェ", "新しく手に入れたこの翼で…\nナイトさんがどこにいたって\nわたし、駆けつけちゃいますよっ！\nクローチェ・エアリアル発進ですっ");
